import React from 'react';
import './LanguageCard.css'

function LanguageCard(props) {
    return (
        <div className="language-card-container">
            <img src={ props.imagem } />
            <p>{ props.descricao }</p>
            <img src={ props.imagem } />
            <p>{ props.descricao }</p>

        </div>
    )
}

export default LanguageCard;
